import React, {Component } from "react";
import '../App.css';
import Skills from '../Components/Skills';
import Header from '../Components/Header';


class App extends Component {
    render() {
        return (
        <main>
          <div className="App">

            {/* ABOUT SECTION */}
            <div className='About'>
              <aside className='sidebar'>
                  <div className='col-md-3'>
                  <img src={gretchpic} className="Gretchen-Image" alt="Gretchen headshot" />
                  <p>Full stack web developer leveraging experience in sales and customer service to build a better and more responsive user experience. Recently earned a professional certificate in full stack coding from Butler University, with recently developed skills in React, JavaScript, Css, and website responsiveness. Interested in expanding knowledge and experience to grow into a successful career in UX/UI design.</p>
                </div>
              </aside>
            </div>

            {/* PROJECTS SECTION */}
          <div className='Projects'>
            <div className="buttonWrapper">
              <button
                type="submit"
                id="portfolioButton"
                className="profile btn-lg"
                onClick={(event) => (window.location.href = "/portfolio")}
                >
                VIEW PORTFOLIO
                </button>
              </div>
            </div>

            {/* SKILLS SECTION */}
            <div className='Skills'>
              <Header
                header="SKILLS"
              />
              <Skills />
              </div>

          </div>
        </main>
        );
      }
      }
      export default App;
